SELECT MIN("probehnuto_mimo_penezenku"."client_id") as agg_0, MAX("probehnuto_mimo_penezenku"."client_id") as agg_1 FROM "probehnuto_mimo_penezenku"  WHERE "probehnuto_mimo_penezenku"."probehla_inzerce_mimo_penezenku" LIKE '%AN%O%' AND "probehnuto_mimo_penezenku"."client_id" BETWEEN 85843 AND 9605280